R["fx__na__@gorak60__62"]="{['TS']=1629644381,['Version']=1758,['Effects']={[1]={['SizeX']=26.456456,['SizeY']=30,['X']=61459,['Id']=1033,['Y']=5995,['EffectType']=8501,['MetaData']={['message']='\\nWelcome to La Lumiere, an installation to celebrate the beauty and artistry of light.\\n\\n\"The purpose of light is to create more light, to open people\\'s eyes, to reveal the marvels around.\"  Paulo Coelho\\n\\nThis project was created to explore the complexities of light, and the effects that can be achieved when creative minds, interesting objects, and the right tools come together on a project. The goal here was to light the structure using only hidden lighting to accentuate details, colours, and shapes.\\n\\nCredit is due to @Totes1 for the original idea, and letting me run with it here, and to @AliToups and @Lumytoons for their critical eye and valuable input.\\n\\nPlease loiter and look, wander and gaze. I hope you enjoy your visit.\\n\\n@Gorak60\\n\\n\\n\\n\\n\\n\\n\"There are dead stars that still shine because their light is trapped in time. Where do I stand in this light, which does not strictly exist?\"  Don DeLillo',['title']='La Lumiere',},['Groups']=0,['Z']=69731,['SizeZ']=30,['Pitch']=4.708898,['Color']=992720,['Contrast']=1,['Alpha']=1,['Roll']=0,['Yaw']=1.994911,},},}"
