R["fx__na__@corundum2003__44"]="{['Effects']={[1]={['Y']=4740,['Roll']=0,['Yaw']=3.497640,['Groups']=0,['SizeZ']=400,['Pitch']=0,['Id']=3820,['Z']=79308,['EffectType']=550,['Alpha']=1,['Color']=55400,['SizeX']=280,['Contrast']=0.160000,['SizeY']=400,['X']=39932,},[2]={['Y']=12990,['Roll']=0,['Yaw']=0.338594,['Groups']=0,['SizeZ']=500,['Pitch']=0,['Id']=3821,['Z']=79466,['EffectType']=551,['Alpha']=0.860000,['Color']=32403,['SizeX']=260,['Contrast']=0.540000,['SizeY']=500,['X']=40005,},[3]={['Id']=3818,['Y']=4636,['X']=40890,['Yaw']=5.061450,['SizeZ']=50,['MetaData']={['title']='There and Back Again, a Hobbit\\'s Tale by Bilbo Baggins',['message']='There once was a Hobbit who lived in a hole, not a nasty, dirty wet hole with nothing in it to sit down on or to eat; it was a hobbit hole, and that means comfort. It had a perfectly round door, like a porhole, painted green, with a shiny yellow brass knob exactly in the middle. This hobbit was a very well-to-do hobbit, and his name was Baggins. The Bagginses had lived in the neighborhood for time out of mind and were very respectable, not only because they were rich, but because they never had any adventures or did anything unexpected. But, this is the story of a Baggins who had an adventure, and found himself doing and saying things altogether unexpected.\\n\\nThe mother of this particular hobbit (Bilbo Baggins) was the famous Belladonna Took, one of three remarkable daughters of the Old Took, head of the hobbits who lived across the Water, the small river that ran at the foot of The Hill. There were stories that one of the Took ancestors must have taken a fairy to wife, which may seem absurd, but there was still something not entirely hobbit about them, and every once in a while members of the Took-clan would go and have adventures.  Not that Belladonna Took had any adventures, and certainly not after she married Bungo Baggins. Bungo, Bilbo\\'s father, built the most luxurious hobbit hole that was to be found either under The Hill or over The Hill or across The Water, and there they remained their entire life.  Bilbo, Belladonna\\'s only son, must have something a little queer in his makeup from the Took side that only awaited a chance to come out.\\n\\nBy some curious chance one morning, long ago in the quiet of the world, Bilbo Baggins was standing at his door after breakfast smoking an enormous long wooden pipe when Gandalf came by. Gandalf! He had been away on business since',},['Pitch']=2.352700,['Groups']=0,['SizeY']=50,['EffectType']=8501,['Alpha']=1,['Color']=100849,['SizeX']=46.456460,['Contrast']=1,['Z']=78366,['Roll']=0,},},['TS']=1623614468,['Version']=1738,}"
