['EffectType']=8000,['Z']=157536,['Id']=1075,['MetaData']={['lore collection']=14,['lore category']=1,['lore book']=3,},['X']=164417,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=1.900000,['Color']=210331,['Roll']=0,['Yaw']=2.455678,['Y']=20262,},[43]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=153552,['Id']=1076,['MetaData']={['title']='Les Argoniens et Sithis',['message']='Les Argoniens ont depuis longtemps entretenus un rapport étroit avec la divinité du néant. Selon les croyances Sithis aurait elle même permis aux hist de connaitre les secrets pour créer les argoniens. D\\'autre pensent même que cette dernière aurai importé l\\'hist originel en Nirn au début de l\\'histoire même. La théorie la plus interressante est que les argoniens sont là pour créer afin que Sithis puisse accomplir le vide, le néant, car la création appelle le néant.\\n\\nLes écailles d\\'ombre et les nisswo (parleur de rien/vide) sont les messagers de Sithis le premier en faisant apelle à sa loi parfois cruel mais juste l\\'autre en incarnant la volonté de l\\'entité par d\\'étranges art. Il est d\\'ailleurs facile de supposer que des bâtisses comme la dent de sithis fut croqué par des architectes Nisswo à l\\'âge d\\'or du peuple argonien.',},['X']=161161,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=2.440000,['Color']=491027,['Roll']=0,['Yaw']=0.429351,['Y']=20313,},[44]={['SizeY']=42,['Pitch']=0,['EffectType']=8502,['Z']=154190,['Id']=1077,['MetaData']={['title']='Les Argoniens et le Cultivation du son',['message']='Les Argoniens de tout peuple utilisés parfois le vent comme moyen de prédire l\\'avenir ou de déterminé si une saison est probable ou non à la reproduction, cutlure ou autres évennements. Ces messagers plus sensible que les autres à la voix dans le vent sont souvent les bras droit ou des conseilelrs des Parles-Sèves, les prêtres du cult de l\\'Hist.\\n\\nCe n\\'est pas tout. Là où dans certaines cultures musicales, comme les arts musicaux nordique, l\\'on conte les louanges ou les débouard de héros, les argoniens eux ne font que transmettre des émotions ou des aspect philosophique de leur culture comme le Shunatei, la peur de l\\'oublie, soit le phénomène que les autres cultures ont a conservés le passé là où les argoniens la laissent filés comme le vent.\\n\\nParmis les instruments iconiques du Marais nouc avons le Vossassalth qui utilise le vent produit par les croassement des grenouilles pour faire des sons variés. La fabriquation de ces instruments est si complexe que seul les artisants les plus talentueux du marais en fabriquent.',},['X']=160612,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=42,['Groups']=1.840000,['Color']=575208,['Roll']=0,['Yaw']=0.911062,['Y']=20366,},[45]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=154830,['Id']=1078,['MetaData']={['title']='Le Mobilier Argonien',['message']='Le peuple des Racines possède un large panel de ressources pour son mobilés, du roseaux à la pierre en passant par le recyclage de produit comme les tonneaux. Bien que les meubles en pierres soit des récupéraions des xanmeer, de chateaux de forme pyramidale, et donc le fruit de la culture argonienne pré-mérétique.\\n\\nCertains meubles sont aussi reconnaissable à leur motifs qui signale souent que ce siège est réservé à un chef de tribu, un prêtre ou des invités spéciaux tel des émissaires d\\'autre tribus ou d\\'autres peuples.',},['X']=160260,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=1.920000,['Color']=40239,['Roll']=0,['Yaw']=1.668535,['Y']=20320,},[46]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=155831,['Id']=1079,['MetaData']={['title']='Les Argoniens, une race qui en cache plusieurs',['message']='Bien que les argoniens soient considérés comem une seule race il sera plus juste de parler d\\'une catégorie propre au même titre que les mer, les peuples elfiques et les man, les peuples humains. Cependant dut �� une incompréhension du peuple de l\\'hist par les étrangés ont fini par dire que tous était d\\'une même race surement dut au sounombre de représentant de chacune des râces.\\n\\nLes saxlheel sont les argoniens les plus commun à la communication avec les autres peuples étrangés. Plus ouvert à la discution et moins rancuniés ils représentent plus de la moitié des argoniens du marais d\\'argonie.\\n\\nLes peuples Naga ou \"hommes-poissons\" sont quant à eux plus féroces et revenchard. Mangeur d\\'étrangés et souvent expert dans la chasse seul une tribu s\\'est ouverte au dialogue avec le reste du monde, les Aiguemortes.\\n\\nLes B��hémoth sont l\\'incarnation plus bestiale de l\\'espèce dut à leur taille énorme, leur habitudes de bêtes sauvages et leur considération de proie par certains autre peuple comme les naga lors des chasses naga, le naga-kur.\\n\\nLes paatrus sont quant à eux les argoniens intelligents les plus dangereux et hostiles. Des chasseurs d\\'hommes il est peu recommandés de croisé le territoiree de ce qui sont qualifiés par les étrangés \"d\\'hommes crapauds\"\\n\\nLes Sarpas sont parmi les argoniens les plus rare, les renseignement sur eux sont minces mais ils semblent qu\\'ils se rapprochent des argoniens saxlheel avec muni d\\'ailes telle les dragon d\\'akatosh.\\n\\nEt enfin les archéens qui sont les argoniens qui visuellement sont les plus proches des mens, de par le manque de leur queue et la forme de leur visage plus proche de celle d\\'un norique que d\\'un bon vieux naga. Leur race peuple surtout Gideon la ville capitale du marais.',},['X']=161196,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=3.040000,['Color']=42241,['Roll']=0,['Yaw']=2.488840,['Y']=20357,},[47]={['Pitch']=0,['SizeY']=287,['EffectType']=660,['Id']=1080,['Yaw']=0.900590,['X']=160078,['Z']=154573,['Contrast']=1,['SizeZ']=287,['Alpha']=1,['Groups']=0,['Color']=696969,['SizeX']=460,['Roll']=0,['Y']=21073,},[48]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=158007,['Id']=1081,['MetaData']={['title']='Les Hist et le Tamriel Pré-Merétique',['message']='Au début de Nirn vint deux formes de vie, les Ehlnofeys et les Hists.\\n\\nLe premier hist vint de l\\'oblivion de par des myen inconnu. Certains pensent que c\\'est Sithis qui pris l\\'Hist pour le posé en Nirn sur Tamriel.\\n\\nA l\\'origine les hists étaient les habitants originaux de Tamriel. Tout le continent était peuplé de magnifiques arbres grillant d\\'un orange ambré unique alors. Les argoniens étaient légions et peuplaient le continent dans des chateaux pyramidaux fait de pierres et de magie. Tamriel était \"l\\'Argonie originel\". Cependant, un jour, les dwemers vinrent sur le continent menaçant l\\'antique cilivisation argonienne. Ils coupèrent les hists menaçant toute les royaumes d\\'Argonie. Les Hist prirent le plus possibles de rescapés et volèrent vers les terres de l\\'actuel marais noir créant un bastion imprenable unissant tout les peuples. Les Argoniens depuis lors ne fait plus devoir de mémoire pour cicatriser de son échec passé.',},['X']=161179,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=2.530000,['Color']=1701,['Roll']=0,['Yaw']=2.443461,['Y']=20309,},[49]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=157772,['Id']=1082,['MetaData']={['title']='Les territoires du Marais Noir',['message']='L\\'Argonie ou Marais Noir est au sud est de Tamriel. Il partage ses frontières avec Elsweyr, Curodiil et Deshaan. Peu de territoires du Marais sont accessible aux peuples étrangés. Celles accessibles sont Fangeombre et depuis quelque temps Tourbevase.\\n\\nLa Capitale du pays se situe en son centre, elle se nomme Gideon et est celle qui regroupe le plus grand nombre d\\'argoniens dans sa périphérie.\\nD\\'autres villes comme Lilmoth au sud sont des point stratégique du point de vu commercial puisqu\\'elle permet un commerce avec des régions plus enfouïe du marais pour avoir des ressources rare comme des roseaux propre à certains territoires.\\n\\nIl y a un temps certains endroits comme la prison de la Rose étaient mais des villes important mais depuis leur chute ils sont plus le repaire de bandit ou de petite tribu qu\\'autre chose.',},['X']=163398,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=2.390000,['Color']=224053,['Roll']=0,['Yaw']=4.059636,['Y']=20319,},[50]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=156799,['Id']=1083,['MetaData']={['title']='Les Ombrécailles, la régence de Tourbevase',['message']='Les Ombrécailles ou écailles d\\'ombre, sont les envoiés de Sithis. Né sous le signe de l\\'ombre il suivent les lois de la confrérie noire et partent au quatres coins de tamriel dans le but d\\'apprendre de leur confrères. Mais lorsque vient la retraite, les écailles d\\'ombre de Tourbevase deviennent une sorte de police juge et bourreau au service des gens au sein du marais. Il enquêtent et prennent la décision la plus pragmatique peu importe à le nombre de mort qu\\'il devra y avoir. Si l\\'accusé et l\\'accuseur sont coupagble il n\\'hésitera jamais à les tuer tout d\\'eux et souvent d\\'une manière ironiquement juste et cruel.\\n\\nCette culture reste souvent secrète révèlant rarement leur philosophie de vie à moins de vous la démontré ensuite.',},['X']=163668,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=2.200000,['Color']=30303,['Roll']=0,['Yaw']=0.916300,['Y']=20291,},[51]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=156759,['Id']=1084,['MetaData']={['title']='Le Repas en Argonie',['message']='Les Argoniens possèdent un régime alimentaire varié. Du ragout d\\'herbes du marais à la chair tendre et fraiche d\\'une brochette de wamasu en passant par un bol de criquets grillés.\\n\\nCertain décrivent aussi des plats plus complexes et complet comme celui d\\'une sort de chaussette d\\'écaille de serpent rempli de riz, de légumes et d\\'une souris vivante. Laissant la souris emprisonné on la laisse s\\'engraisser des légumes et du riz pour finalement la mangé avec le reste au bout de quelque temps alors que la souris aura mariné dans sa propre grasse.\\n\\nBien que le gout soit spécial beaucoup d\\'autre cultures trouve malgrés la méthode le gout très relevé et bon se rapprochant d\\'un pain de viande aux contours croquant et l\\'intérieur un peu grassoueille et doux.',},['X']=164706,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=2.490000,['Color']=727399,['Roll']=0,['Yaw']=4.078834,['Y']=20301,},[52]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=156403,['Id']=1085,['MetaData']={['title']='Les Arbres à Lumière, un cadeau de l\\'Hist',['message']='Les Arbres à lumière sont un moyen assez spécial des argoniens avoir de la lumière. Fait avec une cire spéciale provenant de certaines plantes du marais elles garde la flamme de manière presque continu à moins que trop de vent ou que quelqu\\'un vienne à l\\'éteindre. Certains pense que ce sont les histsqui les gardent allumé mais ce n\\'est qu\\'une légende assez percistante car rien ne semble confirmé cette hypothèse.',},['X']=164544,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=3.500000,['Color']=33341,['Roll']=0,['Yaw']=5.592035,['Y']=20304,},[53]={['SizeY']=40,['Pitch']=0,['EffectType']=4401,['Z']=154992,['Id']=1086,['MetaData']={['message']='Musee de L\\'Argonie',},['X']=163375,['Contrast']=1,['SizeX']=300,['Alpha']=0.750000,['SizeZ']=40,['Groups']=3.940000,['Color']=191919,['Roll']=0,['Yaw']=2.455678,['Y']=28945,},[54]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=153641,['Id']=1087,['MetaData']={['title']='Les Kothringis',['message']='Les plus anciennes traces de ce peuple remontent à l\\'époque de l\\'Ayleidoon où les kothris sont décrits comme étant un peuple esclave des ayléides au côté des nédiques et d\\'autres peuples, vivant dans la vallée du Niben.\\n\\n\\n\\nSuite à la libération des esclaves de l\\'Ayleidoon en 1E 243 la plupart des peuples esclaves des ayléides se métissèrent pour donner naissance aux Impériaux, les kothringis quant à eux restèrent autonomes et s�installèrent dans le Marais Noir.\\n\\n\\n\\nEn 2E 560 la Peste Knahaten ravage le Marais Noir. Toute la population kothri y auraient succombé, bien qu\\'une histoire raconte que le 9 Semailles 2E 563 le navire Le Crimson, empli de kothringis, aurait quitté l\\'Argonie pour chercher refuge face à la peste, rejeté de port en port pendant une année il aurait finalement prit la direction de l\\'ouest et on n\\'entendit plus jamais parler de lui.\\n\\nCette histoire est si célèbre qu\\'elle est jour de fête en Martelfell, le Jour de la Honte le 20 Ondepluie. \\n\\nLes kothringis furent influencés par les ayléides, notamment leur langue est semblable à l\\'Ancien Cyrodilique parlé par ces derniers.\\n\\nIls étaient aussi connus pour vouer un culte à Z\\'en ainsi qu\\'à \"Dibe-Mara-Kin\", les trois-mères dans l\\'Autour-de-Nous.\\n\\n\\n\\nCertaines sources décrivent les kothris comme étant un peuple tribal, d\\'autres parlent de \"ruines immenses et complexes\" ayant été édifiées par les kothris.\\n\\nDe même on dispose de plusieurs sources parlant de \"marins kothris\", or créer des navires pré-suppose une certaine sédentarisation.',},['X']=161106,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=1.500000,['Color']=924499,['Roll']=0,['Yaw']=0.596900,['Y']=20921,},[55]={['SizeY']=30,['Pitch']=0,['EffectType']=8502,['Z']=154800,['Id']=1088,['MetaData']={['title']='Les Lilmothiit',['message']='Les Lilmothiits sont une espèce betmeri du Marais Noir. Qualifiée de vulpine pour son apparence rappelant celle du renard, elle semble génétiquement liée aux khajiits d\\'Elsweyr. L\\'épidémie de peste knahataine qui débute en 2E 560 serait à l\\'origine de la disparition des Lilmothiits.\\n\\n\\n\\nIls ont fondé dans le Marais Noir une cité nommée Rose noire. Durant l\\'�re Seconde, le potentat Versidae-Shae fait ériger une prison sur les ruines de la ville.\\n\\n\\n\\nL\\'espèce est considérée comme nomade et cantonnée aux côtes sud du pays, mais il est probable que la cité de Lilmoth lui doive son nom. ',},['X']=160068,['Contrast']=1,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Groups']=1.810000,['Color']=115799,['Roll']=0,['Yaw']=1.846558,['Y']=20929,},[56]={['SizeY']=60,['Pitch']=0,['EffectType']=4401,['Z']=157267,['Id']=1089,['MetaData']={['message']='Terrasse Nisswo',},['X']=164879,['Contrast']=1,['SizeX']=380,['Alpha']=0.750000,['SizeZ']=60,['Groups']=3.940000,['Color']=171717,['Roll']=0,['Yaw']=2.462660,['Y']=28712,},[57]={['SizeY']=1230,['Pitch']=0,['EffectType']=8502,['Z']=159724,['Id']=1090,['MetaData']={['title']='Campement argonien',['message']='Ceci est un campement ouvert aux argoniens errants dans la région. Merci de ne pas déranger les habitants de ces tentes.',},['X']=166286,['Contrast']=1,['SizeX']=1226.456456,['Alpha']=0,['SizeZ']=1230,['Groups']=1,['Color']=102439,['Roll']=0,['Yaw']=4.054400,['Y']=28322,},},['Version']='15.7.9',},[2]={['TS']=1604179003,['World']='eu',['HouseId']=3,['Effects']={[1]={['Roll']=0,['SizeY']=1300,['Pitch']=0,['Id']=1093,['Yaw']=1.525418,['X']=26650,['Alpha']=1,['Z']=24664,['SizeZ']=1300,['EffectType']=878,['Groups']=0,['Color']=9904,['SizeX']=1100,['Contrast']=1,['Y']=21223,},[2]={['Roll']=0,['SizeY']=1300,['Pitch']=1.570971,['Id']=1094,['Yaw']=1.525418,['X']=26650,['Alpha']=1,['Z']=24664,['SizeZ']=1300,['EffectType']=878,['Groups']=0,['Color']=9904,['SizeX']=1100,['Contrast']=1,['Y']=20970,},[3]={['Roll']=0,['SizeY']=1300,['Pitch']=0,['Id']=1095,['Yaw']=0.740020,['X']=26686,['Alpha']=1,['Z']=24484,['SizeZ']=1300,['EffectType']=878,['Groups']=0,['Color']=9904,['SizeX']=1100,['Contrast']=1,['Y']=21223,},[4]={['Roll']=0,['SizeY']=1300,['Pitch']=0,['Id']=1096,['Yaw']=6.150540,['X']=26724,['Alpha']=1,['Z']=24310,['SizeZ']=1300,['EffectType']=878,['Groups']=0,['Color']=9904,['SizeX']=1100,['Contrast']=1,['Y']=21223,},},['Version']='15.7.9',},},['TS']=1604179003,}"
