tType']=5106,['Contrast']=1,['Pitch']=4.715880,['SizeX']=18.256410,['Yaw']=1.979203,['Y']=20665,['Id']=1053,['Roll']=0,['Z']=24001,['SizeY']=14,},[3]={['X']=19641,['Alpha']=1,['Groups']=0,['Color']=999999,['SizeZ']=148,['EffectType']=453,['Contrast']=1,['Pitch']=6.021386,['SizeX']=100,['Yaw']=2.042035,['Y']=20639,['Id']=1054,['Roll']=0,['Z']=24130,['SizeY']=148,},[4]={['X']=20540,['Alpha']=1,['SizeX']=160,['Groups']=0,['Color']=999999,['MetaData']={['message']='Welcome to The Wild Vine! Have a seat and wait to be served...',['name']='The Argonian Maid ',},['EffectType']=5056,['Contrast']=1,['Pitch']=0,['SizeZ']=260,['Yaw']=3.935717,['Y']=20161,['Id']=1055,['Roll']=0,['Z']=24982,['SizeY']=260,},},['World']='eu',['HouseId']=13,},[3]={['TS']=1605574412,['Version']='15.8.8',['Effects']={[1]={['X']=113042,['Alpha']=1,['SizeX']=26.456456,['Groups']=0,['Color']=273749,['MetaData']={['message']='Ash lay writhing over the horizon\\n\\nwith spores of light within the ground\\'s own darkness, \\n\\ndown the soil from east to west. \\n\\nAn interred storm of brown dust rising\\n\\nechoing the sound of a people\\'s shout\\n\\nfor light and freedom and the end of drought. \\n\\nDown the ages, mortared doctrines tumble\\n\\nBeneath the lash of vocalized winds\\n\\nblowing fiery debris back upon their tombs\\n\\nturning stone sculptures into ashen spaces. \\n\\nCircling higher the winds ascending\\n\\nlifting up the ashes unto the paternal heavens\\n\\ncrying for invocation with their muted voices \\n\\nimpassable shadow the recompense for their choices.',['title']='Timeless Reverie',},['EffectType']=8503,['Contrast']=1.050000,['Pitch']=5.016076,['SizeZ']=36,['Yaw']=5.516986,['Y']=71196,['Id']=1063,['Roll']=0,['Z']=123996,['SizeY']=36,},[2]={['X']=108440,['Alpha']=1,['SizeZ']=50,['Groups']=0,['Color']=30431,['MetaData']={['message']='Journal extract (in a feminine hand) - date unknown: \\n\\nWe found our way at last, and are no longer to be bothered by the outsiders. New chambers need be built though, for much of what once was got shattered in the process. Never attempt such magic again - but alas the cost was worth it! The few casualties were expected and a proper burial place found for their remains. \\n\\nJouranl extract 1: \\n\\nThe land is rich yet no proper crops can be grown upon it, and our resources grow slimmer by the day. His studies of the fungi though enables new resources. Testing subjects proved successful in the past month. Potential side effects to be dealt with. \\n\\nJournal extract 2: \\n\\nNo magic works, alchemy either. The greed and hunger drove them all towards it, and now they sing a mindless - ooom - while worshiping the fungi for their gods (or so it seems if one were to judge by their ecstatic gestures in the garden).  What hope is there? The few supplies can barely last the two of us, oh why have we agreed on such a foolish task? What good is magic if we cannot grasp its depths? What good is knowledge in so limited a mind?\\n\\nJournal extract 4 - (unknown handwriting):\\n\\nFinally... awoken. We wouldn\\'t have made it without my gifts, and what a delicious world this is! Pity the wretched creatures had to die in order to allow it, but what is life without a little bit of death? - (at length the handwriting changes, becoming that same feminine from the old entries): \\n\\nBegone, stop meddling with my thoughts.  You are not here I AM - and shall forever be! The plants... their whispers... yes.. .their blood! Alas we LIVE!\\n\\nJournal extract 6 -  (in Alma\\'s handwriting, which is a mixture of the two previous  feminine styles): \\n\\nThe sound is the key. ',['title']='Alma\\'s Journal',},['EffectType']=8501,['Contrast']=0.320000,['Pitch']=5.037020,['SizeX']=33.456456,['Yaw']=0.752237,['Y']=39228,['Id']=1064,['Roll']=0,['Z']=125383,['SizeY']=50,},[3]={['X']=109305,['Alpha']=1,['SizeZ']=44,['Groups']=0,['Color']=0,['MetaData']={['message']='Journal extract:\\n\\nThey bid us leave the land. All those gathered around Veloth have agreed. We have but one solution of avoidance, the secret spell. The risk is great, but greater shall the loss of our research be if we follow them now. It shall be done. What once was up shall forever sink bellow. \\n\\nJournal extract 1: \\n\\nAt last, the dice was cast. Of all our order only me and Alma stay, the rest succumbed to the abyss. They call it Oom. Queer. \\n\\nJournal extract 2:\\n\\nThe gate is the only option. I KNOW this will surpass even the borders of Aurbis. He told me. He visits me in dreams and tells me the solution. I just need one more ingredient.. I wonder.. will she agree to borrow me her blood? It may well be the last ingredient for the spell, together we shall make it! \\n\\nJourmal extract 3:\\n\\nWe must depart. The place can no longer be safely contained, her music drives them forth, and we must go on with the research. Perhaps a brake, yes, a few centuries above. \\n\\nJournal extract 4: \\n\\nAlma refuses to see the world. She claims she is being used and only seclusion will prevent the other one to see. Oddly enough I believe her. Tomorrow the spell for our souls shall be performed, only thus we may gain some freedom of movement. ',['title']='Nostro\\'s Journal',},['EffectType']=8501,['Contrast']=0.530000,['Pitch']=5.057964,['SizeX']=35,['Yaw']=3.921755,['Y']=39224,['Id']=1065,['Roll']=0,['Z']=126293,['SizeY']=44,},},['World']='eu',['HouseId']=79,},[4]={['TS']=1609019973,['Version']='16.0.9',['Effects']={},['World']='eu',['HouseId']=63,},[5]={['TS']=1610931017,['Version']='16.0.9',['Effects']={[1]={['X']=62990,['Alpha']=1,['Groups']=0,['Color']=996949,['SizeZ']=500,['EffectType']=970,['Contrast']=1,['Pitch']=0,['SizeX']=500,['Yaw']=0.923279,['Y']=10818,['Id']=1066,['Roll']=0,['Z']=46086,['SizeY']=500,},[2]={['X']=63044,['Alpha']=1,['Groups']=0,['Color']=996949,['SizeZ']=300,['EffectType']=972,['Contrast']=1,['Pitch']=0,['SizeX']=300,['Yaw']=0.923279,['Y']=10718,['Id']=1067,['Roll']=0,['Z']=46054,['SizeY']=300,},[3]={